// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract AuctionEngine {
    address public owner;
    uint256 constant DURATION = 2 days;
    uint256 constant FEE = 10; // %
    struct Auction {
        address payable seller;
        uint256 startingPrice;
        uint256 finalPrice;
        uint256 startAt;
        uint256 endsAt;
        uint256 discountRate;
        string item;
        bool stopped;
    }
    Auction[] public auctions;

    event AuctionCreated(
        uint256 index,
        string itemName,
        uint256 startingPrice,
        uint256 duration
    );
    event AuctionEnded(uint256 index, uint256 finalPrice, address winner);

    constructor() {
        owner = msg.sender;
    }

    function createAuction(
        uint256 _startingPrice,
        uint256 _discountRate,
        string calldata _item,
        uint256 _duration
    ) external {
        uint256 duration = _duration == 0 ? DURATION : _duration;

        require(
            _startingPrice >= _discountRate & duration,
            "incorrect starting price"
        );

        Auction memory newAuction = Auction({
            seller: payable(msg.sender),
            startingPrice: _startingPrice,
            finalPrice: _startingPrice,
            discountRate: _discountRate,
            startAt: block.timestamp,
            endsAt: block.timestamp + duration,
            item: _item,
            stopped: false
        });

        auctions.push(newAuction);

        emit AuctionCreated(
            auctions.length - 1,
            _item,
            _startingPrice,
            duration
        );
    }

    function getPriceFor(uint256 index) public view returns (uint256) {
        Auction storage cAuction = auctions[index];
        require(!cAuction.stopped, "stopped!");
        uint256 elapsed = block.timestamp - cAuction.startAt;
        uint256 discount = cAuction.discountRate * elapsed;
        return cAuction.startingPrice - discount;
    }

    function stop(uint256 index) external {
        Auction storage cAuction = auctions[index];
        cAuction.stopped = true;
    }

    function buy(uint256 index) external payable {
        Auction storage cAuction = auctions[index];
        require(!cAuction.stopped, "stopped!");
        require(block.timestamp < cAuction.endsAt, "ended!");
        uint256 cPrice = getPriceFor(index);
        require(msg.value >= cPrice, "not enough funds!");
        cAuction.stopped = true;
        cAuction.finalPrice = cPrice;

        uint256 refund = msg.value - cPrice;
        if (refund > 0) {
            (bool sentToBuyer, ) = payable(msg.sender).call{value: refund}("");
            require(sentToBuyer, "Failed to send Ether");
        }

        (bool sentToSeller, ) = cAuction.seller.call{
            value: cPrice - ((cPrice * FEE) / 100)
        }("");
        require(sentToSeller, "Failed to send Ether");

        emit AuctionEnded(index, cPrice, msg.sender);
    }
}

contracts/CRUD.sol.content:
// SPDX-License-Identifier: UNLICENSED

pragma solidity >=0.8.9 <0.9.0;

contract CRUD {
    struct User {
        uint256 id;
        string name;
    }

    User[] public users;
    uint256 public _id = 1;

    function create(string memory name) public {
        users.push(User(_id, name));
        _id++;
    }

    function read(uint256 id) public view returns (uint256, string memory) {
        uint256 i = _find(id);
        return (users[i].id, users[i].name);
    }

    function update(uint256 id, string memory name) public {
        users[_find(id)].name = name;
    }

    function destroy(uint256 id) public {
        delete users[_find(id)];
    }

    function _find(uint256 id) internal view returns (uint256) {
        for (uint256 i; i < users.length; i++) {
            if (users[i].id == id) {
                return i;
            }
        }

        revert("User doesn't exist!");
    }
}

contracts/Escrow.sol.content:
// SPDX-License-Identifier: UNLICENSED

pragma solidity >=0.8.9 <0.9.0;

contract Escrow {
    address public payer;
    address payable public payee;
    address public lawyer;
    uint256 public amount;

    constructor(
        address _payer,
        address payable _payee,
        uint256 _amount
    ) {
        payer = _payer;
        payee = _payee;
        lawyer = msg.sender;
        amount = _amount;
    }

    function deposit() public payable {
        require(msg.sender == payer, "Sender must be a payer");
        require(address(this).balance <= amount);
    }

    function release() public {
        require(
            address(this).balance == amount,
            "Cannot release funds before full amount is sent"
        );
        require(msg.sender == lawyer, "Only lawyer can release funds");
        (bool sent, ) = payee.call{value: amount}("");
        require(sent, "Failed to send Ether");
    }

    function balanceOf() public view returns (uint256) {
        return address(this).balance;
    }
}

